// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Используем BrowserRouter как Router
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import CreateEntry from './pages/CreateEntry';
import ViewEntries from './pages/ViewEntries';
import ResetPassword from './pages/ResetPassword'; // Импортируем компонент для сброса пароля

function App() {
    return (
        <Router> {/* Используем BrowserRouter (через Router) */}
            <div>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/create-entry" element={<CreateEntry />} />
                    <Route path="/entries" element={<ViewEntries />} />
                    <Route path="/reset-password" element={<ResetPassword />} /> {/* Новый маршрут для сброса пароля */}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
